def findAllFileFilter(base):
    for root, ds, fs in os.walk(base):
        for f in fs:
            if re.match(r'.*.pdf|.PDF|.Pdf|.PDf|.pDF', f):
                fullname = os.path.join(root, f)
                yield fullname


def findAllFile(base):
    for root, ds, fs in os.walk(base):
        for f in fs:
            # if not re.match(r'.*.pdf|.PDF|.Pdf|.PDf|.pDF', f):
            fullname = os.path.join(root, f)
            yield fullname


