def extract_tables_from_pdf(pdf_path, excel_path):
    try:
        # 读取PDF文件中的所有表格
        tables = tabula.read_pdf(pdf_path, pages='all', multiple_tables=True)
        # 创建一个Excel写入器
        writer = pd.ExcelWriter(excel_path)
        # 将每个表格合并到一个数据框中
        merged_table = pd.concat(tables, ignore_index=True)
        # 将合并的表格写入Excel文件中的一个工作表
        merged_table.to_excel(writer, sheet_name='All Tables', index=False)

        # 保存Excel文件
        writer.close()
    except Exception as e:
        text1.insert(ttk.END, "转换失败.... " + e.__dict__.__str__() + "\n")
        text1.see(ttk.END)


def extract_tables_from_pdf_split_sheet(pdf_path, excel_path):
    try:
        # 读取PDF文件中的所有表格
        tables = tabula.read_pdf(pdf_path, pages='all', multiple_tables=True)
        # 创建一个Excel写入器
        writer = pd.ExcelWriter(excel_path)
        # 将每个表格单独sheet
        for i in range(0, len(tables)):
            df = pd.DataFrame(tables[i])
            df.to_excel(writer, sheet_name=f'sheet_{i}', index=False)
            text1.insert(ttk.END, "填充excel.... " + "sheet_ " + i.__str__() + "\n")
            text1.see(ttk.END)
        # 保存Excel文件
        writer.close()
    except Exception as e:
        text1.insert(ttk.END, "转换失败.... " + e.__dict__.__str__() + "\n")
        text1.see(ttk.END)


