def delete_files(path):
    global filepath
    try:
        del_list = os.listdir(path)
        for f in del_list:
            file_path = os.path.join(path, f)
            if os.path.isfile(file_path):
                os.remove(file_path)
            elif os.path.isdir(file_path):
                shutil.rmtree(file_path)
    except Exception as e:
        text1.insert(ttk.END, "文件夹下文件:{} 删除失败:{}。。。".format(filepath, e.__str__()) + "\n")
        text1.see(ttk.END)
    finally:
        reload(textneedEntry.get())


# 使用fitz 库直接提取pdf的图像
def muExtractImages(file_name):
    # pdf = os.path.join(Path(in_file_path).resolve(),file)

    # 打开pdf，打印PDF的相关信息
    doc = fitz.open(file_name)
    # 图片计数
    imgcount = 0
    lenXREF = doc.xref_length()  # 获取pdf文件对象总数

    if len(doc) <= 0:
        text1.insert(ttk.END, "打印PDF的信息---文件名:{} 为空文档 不需要提取。。。".format(file_name) + "\n")
        text1.see(ttk.END)
        doc.close()
        return
        # 打印PDF的信息
    text1.insert(ttk.END, "打印PDF的信息---文件名:{}, 页数: {}, 对象: {}".format(file_name, len(doc), lenXREF - 1) + "\n")
    text1.see(ttk.END)
    filename, extension = os.path.splitext(os.path.basename(file_name))
    dir = textneedEntry.get()
    pic_path = os.path.join(dir, filename).replace('\\', '/')
    if not os.path.exists(pic_path):
        os.mkdir(pic_path)
        text1.insert(ttk.END, "创建图片保存目录.... " + "{}".format(pic_path) + "\n")
        text1.see(ttk.END)
    else:
        try:
            delete_files(pic_path)
            # reload(dir)
        except Exception as e:
            text1.insert(ttk.END, "删除目录下的图片失败... " + pic_path.__str__() + e.__str__() + "\n")
            text1.see(ttk.END)

    # 遍历doc，获取每一页
    text1.insert(ttk.END, "开始提取图片.... " + pic_path.__str__() + "\n")
    text1.see(ttk.END)
    for page in doc:
        try:
            imgcount += 1
            tupleImage = page.get_images()
            if len(tupleImage) <= 0:
                text1.insert(ttk.END, "第 " + page.__str__() + "页 含有" + len(tupleImage).__str__() + "张图片--当前页不需要提取图片 \n")
                text1.see(ttk.END)
                return
            text1.insert(ttk.END, "第 " + page.__str__() + "页 含有" + len(tupleImage).__str__() + "张图片 \n")
            text1.see(ttk.END)
            for xref in list(tupleImage):
                xref = list(xref)[0]
                img = doc.extract_image(xref)  # 获取文件扩展名，图片内容 等信息
                imageFilename = ("%s-%s." % (imgcount, xref) + img["ext"])
                imageFilename = os.path.join(pic_path, imageFilename)  # 合成最终图像完整路径名
                text1.insert(ttk.END, "合成最终图像" + imageFilename.__str__() + "\n")
                text1.see(ttk.END)
                imgout = open(imageFilename, 'wb')  # byte方式新建图片
                imgout.write(img["image"])  # 当前提取的图片写入磁盘
                text1.insert(ttk.END, "当前提取的图片写入磁盘" + imageFilename.__str__() + "\n")
                text1.see(ttk.END)
                dt_changed.insert_row(values=[imageFilename.__str__()])
                dt_changed.load_table_data()
                imgout.close
        except Exception as e:
            text1.insert(ttk.END, "第 " + imgcount.__str__() + " 张图片提取失败.... " + e.__str__() + "\n")
            text1.see(ttk.END)
        finally:
            text1.insert(ttk.END, "图片提取完成.... " + pic_path.__str__() + "\n")
            text1.see(ttk.END)


