def split_pdf(input_pdf):
    pdf_document = fitz.open(input_pdf)

    if pdf_document.page_count <= 1:
        text1.insert(ttk.END, "打印PDF的信息---文件名:{} 为空文档或者只有一页 不需要拆分。。。".format(input_pdf) + "\n")
        text1.see(ttk.END)
        pdf_document.close()
        return
    else:
        # 打印PDF的信息
        text1.insert(ttk.END, "打印PDF的信息---文件名:{}, 页数: {}".format(input_pdf, pdf_document.page_count) + "\n")
        text1.see(ttk.END)
        filename, extension = os.path.splitext(os.path.basename(input_pdf))
        dir = textneedEntry.get()
        spilt_path = os.path.join(dir, filename + "_pdf").replace('\\', '/')

        if not os.path.exists(spilt_path):
            os.mkdir(spilt_path)
            text1.insert(ttk.END, "创建拆分保存目录.... " + "{}".format(spilt_path) + "\n")
            text1.see(ttk.END)
        else:
            try:
                delete_files(spilt_path)
                # reload(dir)
            except Exception as e:
                text1.insert(ttk.END, "删除目录下的pdf失败... " + spilt_path.__str__() + e.__str__() + "\n")
                text1.see(ttk.END)

        try:
            for page_num in range(pdf_document.page_count):
                page = pdf_document[page_num]

                # 构建输出文件名，以页数命名
                output_pdf = os.path.join(spilt_path, "Page_" + (page_num + 1).__str__() + ".pdf")  # 合成最终图像完整路径名
                text1.insert(ttk.END, "创建pdf拆分页面... " + output_pdf.__str__() + "\n")
                text1.see(ttk.END)
                # 创建一个新的Document对象，包含当前页面
                new_pdf = fitz.open()
                new_pdf.insert_pdf(pdf_document, from_page=page_num, to_page=page_num)

                # 保存单独的PDF文件
                new_pdf.save(output_pdf)
                new_pdf.close()
                text1.insert(ttk.END, "保存pdf拆分页面成功... " + output_pdf.__str__() + "\n")
                text1.see(ttk.END)
                dt_changed.insert_row(values=[output_pdf.__str__()])
                dt_changed.load_table_data()
            pdf_document.close()
        except Exception as e:
            text1.insert(ttk.END, "拆分pdf失败... " + spilt_path.__str__() + e.__str__() + "\n")
            text1.see(ttk.END)

