def merge_pdfs(files_pdf):
    pdf_merger = fitz.open()

    if len(files_pdf) <= 1:
        text1.insert(ttk.END, "只有一个pdf文件不需要合并 。。。".format(files_pdf) + "\n")
        text1.see(ttk.END)
        pdf_merger.close()
        return
    else:
        filename, extension = os.path.splitext(os.path.basename(files_pdf[0]))
        dir = textneedEntry.get()
        merger_file = os.path.join(dir, filename + "_merger.pdf").replace('\\', '/')
        text1.insert(ttk.END, "合并pdf文件... " + merger_file.__str__() + "\n")
        text1.see(ttk.END)

        try:
            for pdf in files_pdf:
                pdf_document = fitz.open(pdf)
                if pdf_document.page_count <= 0:
                    text1.insert(ttk.END, "打印PDF的信息---文件名:{} 为空文档或者只有一页 不需要合并 。。。".format(pdf) + "\n")
                    text1.see(ttk.END)
                    pdf_document.close()
                    return
                else:
                    pdf_merger.insert_pdf(pdf_document)
            pdf_merger.save(merger_file)
            pdf_merger.close()
            text1.insert(ttk.END, "合并pdf成功... " + merger_file.__str__() + "\n")
            text1.see(ttk.END)
            dt_changed.insert_row(values=[merger_file.__str__()])
            dt_changed.load_table_data()
        except Exception as e:
            text1.insert(ttk.END, "合并pdf失败... " + merger_file.__str__() + e.__str__() + "\n")
            text1.see(ttk.END)


