def change_images(input_pdf):
    pdf_document = fitz.open(input_pdf)
    if pdf_document.page_count <= 0:
        text1.insert(ttk.END, "打印PDF的信息---文件名:{} 为空文档不需要转换。。。".format(input_pdf) + "\n")
        text1.see(ttk.END)
        pdf_document.close()
        return
    else:
        # 打印PDF的信息
        text1.insert(ttk.END, "打印PDF的信息---文件名:{}, 页数: {}".format(input_pdf, pdf_document.page_count) + "\n")
        text1.see(ttk.END)
        filename, extension = os.path.splitext(os.path.basename(input_pdf))
        dir = textneedEntry.get()
        imgs_path = os.path.join(dir, filename + "_imgs").replace('\\', '/')

        if not os.path.exists(imgs_path):
            os.mkdir(imgs_path)
            text1.insert(ttk.END, "创建转换图片保存目录.... " + "{}".format(imgs_path) + "\n")
            text1.see(ttk.END)
        else:
            try:
                delete_files(imgs_path)
                # reload(dir)
            except Exception as e:
                text1.insert(ttk.END, "删除目录下的pdf失败... " + imgs_path.__str__() + e.__str__() + "\n")
                text1.see(ttk.END)

        try:
            for page_num in range(pdf_document.page_count):
                page = pdf_document[page_num]
                img_file = os.path.join(imgs_path, 'images_%s.jpg' % page_num).replace('\\', '/')
                rotate = int(0)
                # 每个尺寸的缩放系数为1.3，这将为我们生成分辨率提高2.6的图像。
                # 此处若是不做设置，默认图片大小为：792X612, dpi=72
                zoom_x = 1.33333333  # (1.33333333-->1056x816)   (2-->1584x1224)
                zoom_y = 1.33333333
                mat = fitz.Matrix(zoom_x, zoom_y).prerotate(rotate)
                pix = page.get_pixmap(matrix=mat)  # 将图片写入指定的文件夹内
                pix.save(img_file)
                text1.insert(ttk.END, "删除目录下的pdf失败... " + img_file.__str__()  + "\n")
                text1.see(ttk.END)
                dt_changed.insert_row(values=[img_file.__str__()])
                dt_changed.load_table_data()
        except Exception as e:
            text1.insert(ttk.END, "删除目录下的pdf失败... " + imgs_path.__str__() + e.__str__() + "\n")
            text1.see(ttk.END)
    pdf_document.close()
    

